import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

// Main SuccessPage component
export default function SuccessPage() {
  const navigate = useNavigate();
  const [countdown, setCountdown] = useState(4); // Initialize countdown at 4 seconds

  useEffect(() => {
    const interval = setInterval(() => {
      setCountdown((prev) => {
        if (prev <= 1) {
          clearInterval(interval);
          return 0;
        }
        return prev - 1;
      });
    }, 1000);

    const timer = setTimeout(() => {
      navigate("/pay");
    }, 4000);

    return () => {
      clearInterval(interval);
      clearTimeout(timer);
    };
  }, [navigate]);

  return (
    <div style={styles.pageContainer} className="page-container">
      <SuccessCard countdown={countdown} />
    </div>
  );
}

// Styles
const styles = {
  pageContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
    backgroundImage: "url('/assets/images/succesban.png')", // Background image
    backgroundSize: "cover", // Cover whole screen
    backgroundRepeat: "no-repeat", // No repeating
    backgroundAttachment: "fixed", // Fixed while scrolling
    backgroundPosition: "center", // Center image
    fontFamily: "'Segoe UI', sans-serif",
    padding: "20px",
  },
  cardWrapper: {
    borderRadius: "20px",
    background: "rgba(255, 255, 255, 0.9)",
    backdropFilter: "blur(12px)",
    padding: "40px 30px",
    maxWidth: "500px",
    width: "100%",
    boxShadow: "0 8px 16px rgba(0,0,0,0.2)",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    textAlign: "center",
  },
  header: {
    fontSize: "2rem",
    marginBottom: "15px",
    fontWeight: "bold",
  },
  thankYou: {
    fontSize: "1.1rem",
    lineHeight: "1.5",
    marginBottom: "25px",
    maxWidth: "400px",
  },
  checkmarkContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  countdownText: {
    fontSize: "1rem",
    marginTop: "10px",
    padding: "0 10px",
  },
  additionalInfo: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  infoText: {
    marginBottom: "8px",
    textAlign: "center",
    maxWidth: "350px",
  },
  redirectButton: {
    padding: "10px 20px",
    fontSize: "1rem",
    borderRadius: "8px",
    border: "none",
    backgroundColor: "#28a745",
    color: "#fff",
    cursor: "pointer",
    boxShadow: "0 4px 8px rgba(0,0,0,0.2)",
    transition: "all 0.3s ease",
  },
  footer: {
    marginTop: "20px",
    fontSize: "0.9rem",
    color: "#555",
    textAlign: "center",
  },
};

// SuccessCard
function SuccessCard({ countdown }) {
  return (
    <div style={styles.cardWrapper} className="card-wrapper animate__animated animate__fadeInDown">
      <HeaderSection />
      <ThankYouMessage />
      <CheckmarkAnimation />
      <CountdownMessage countdown={countdown} />
      <AdditionalInfo />
      <Footer />
    </div>
  );
}

// Header
function HeaderSection() {
  return (
    <h2 style={styles.header} className="text-success mb-3">
      🎉 Payment Successful!
    </h2>
  );
}

// Thank you message
function ThankYouMessage() {
  return (
    <p style={styles.thankYou} className="text-muted">
      Thank you for your payment. Your transaction has been securely processed.
    </p>
  );
}

// Checkmark
function CheckmarkAnimation() {
  return (
    <div style={styles.checkmarkContainer} className="my-4">
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="120"
        height="120"
        fill="none"
        stroke="green"
        strokeWidth="4"
        viewBox="0 0 24 24"
        className="mx-auto animate__animated animate__bounceIn"
      >
        <path d="M5 13l4 4L19 7" />
      </svg>
    </div>
  );
}

// Countdown
function CountdownMessage({ countdown }) {
  return (
    <p style={styles.countdownText} className="text-secondary small mt-3">
      Redirecting back to payment page in{" "}
      <strong style={{ color: "#28a745" }}>{countdown}</strong> seconds...
    </p>
  );
}

// Extra info
function AdditionalInfo() {
  return (
    <div style={styles.additionalInfo} className="mt-4">
      <p style={styles.infoText} className="text-muted small mb-2">
        If you are not redirected automatically, please click the button below.
      </p>
      <button
        style={styles.redirectButton}
        onClick={() => (window.location.href = "/pay")}
      >
        Go to Payment Page
      </button>
    </div>
  );
}

// Footer
function Footer() {
  return (
    <div style={styles.footer} className="mt-4">
      <p>&copy; 2024 YourCompany. All rights reserved.</p>
    </div>
  );
}
